    private void makeTargetListTempest() {
        for (L1Object tgobj : L1World.getInstance().getVisibleObjects((L1Object)this._player, this._skill.getArea())) {
            if (tgobj == null || !isEnemyTarget(tgobj))
                continue;
            this._targetList.add(new TargetStatus((L1Character)tgobj));
            if (tgobj instanceof L1PcInstance) {
                ((L1PcInstance)tgobj).send_effect(20604);
                continue;
            }
            ((L1Character)tgobj).broadcastPacket((ServerBasePacket)new S_SkillSound(tgobj.getId(), 20604), true);
        }
    }

    private boolean isEnemyTarget(L1Object obj) {
        try {
            if (!(obj instanceof L1MonsterInstance) && !(obj instanceof L1PcInstance) && !(obj instanceof L1SummonInstance) && !(obj instanceof L1PetInstance))
                return false;
            L1Character cha = (L1Character)obj;
            if (cha.getId() == this._player.getId())
                return false;
            if ((cha instanceof L1PcInstance || cha instanceof L1SummonInstance || cha instanceof L1PetInstance) && cha.getZoneType() == 1)
                return false;
            if (cha instanceof L1PcInstance && ((((L1PcInstance)cha).getClanid() > 0 && ((L1PcInstance)cha).getClanid() == this._player.getClanid()) || (this._player.getParty() != null && this._player.getParty().isMember((L1PcInstance)cha))))
                return false;
            if (!isTarget(cha) || !this._player.glanceCheck(cha.getX(), cha.getY()))
                return false;
        } catch (Exception e) {
            e.printStackTrace();
            return false;
        }
        return true;
    }

