    private void useConsume() {
        if (this._user instanceof L1NpcInstance) {
            int current_hp = this._npc.getCurrentHp() - this._hpConsume;
            this._npc.setCurrentHp(current_hp);
            int current_mp = this._npc.getCurrentMp() - this._mpConsume;
            this._npc.setCurrentMp(current_mp);
            return;
        }
        if (isHPMPConsume()) {
            int current_hp = this._player.getCurrentHp() - this._hpConsume;
            this._player.setCurrentHp(current_hp);
            int current_mp = this._player.getCurrentMp() - this._mpConsume;
            this._player.setCurrentMp(current_mp);
        }
        int lawful = this._player.getLawful() + this._skill.getLawful();
        if (lawful > 32767)
            lawful = 32767;
        if (lawful < -32767)
            lawful = -32767;
        this._player.setLawful(lawful);
        int itemConsume = this._skill.getItemConsumeId();
        int itemConsumeCount = this._skill.getItemConsumeCount();
        if (itemConsume == 0 || this._player.getAI() != null)
            return;
        if (itemConsume == 40318) {
            if (this._player.getInventory().checkItem(30079, itemConsumeCount) && this._player.getLevel() < 82)
                itemConsume = 30079;
        } else if (itemConsume == 40321) {
            if (this._player.getInventory().checkItem(30080, itemConsumeCount) && this._player.getLevel() < 82)
                itemConsume = 30080;
        } else if (itemConsume == 210035) {
            if (this._player.getInventory().checkItem(30081, itemConsumeCount) && this._player.getLevel() < 82)
                itemConsume = 30081;
        } else if (itemConsume == 210038) {
            if (this._player.getInventory().checkItem(30082, itemConsumeCount) && this._player.getLevel() < 82)
                itemConsume = 30082;
        } else if (itemConsume == 40319 &&
                this._player.getInventory().checkItem(30078, itemConsumeCount) && this._player.getLevel() < 82) {
            itemConsume = 30078;
        }
        this._player.getInventory().consumeItem(itemConsume, itemConsumeCount);
    }

