    private void useCubeMagic(int skillid) {
        L1PcInstance pc = (L1PcInstance)this._user;
        L1Party party = pc.getParty();
        if (pc.hasSkillEffect(skillid))
            pc.removeSkillEffect(skillid);
        pc.send_effect(this._skill.getCastGfx());
        pc.setSkillEffect(skillid, (this._skill.getBuffDuration() * 1000));
        if (party != null)
            switch (skillid) {
                case 220:
                    on_icons(pc, skillid, this._getBuffIconDuration);
                    for (L1PcInstance player : L1World.getInstance().getVisiblePlayer((L1Object)pc, 18)) {
                        if (pc.getParty().isMember(player)) {
                            if (player.hasSkillEffect(220))
                                player.removeSkillEffect(220);
                            player._CubeEffect = true;
                            player.send_effect(this._skill.getCastGfx());
                            player.setSkillEffect(220, (this._skill.getBuffDuration() * 1000));
                            on_icons(player, 220, this._getBuffIconDuration);
                        }
                    }
                    break;
                case 215:
                    pc.getAbility().addSp(2);
                    for (L1PcInstance player : L1World.getInstance().getVisiblePlayer((L1Object)pc, 18)) {
                        if (pc.getParty().isMember(player)) {
                            if (player.hasSkillEffect(215))
                                player.removeSkillEffect(215);
                            player._CubeEffect = true;
                            player.send_effect(this._skill.getCastGfx());
                            player.getAbility().addSp(2);
                            on_icons(player, 215, this._getBuffIconDuration);
                            player.setSkillEffect(215, (this._skill.getBuffDuration() * 1000));
                        }
                    }
                    break;
                case 205:
                    on_icons(pc, skillid, this._getBuffIconDuration);
                    pc.addDmgup(4);
                    pc.addHitup(4);
                    for (L1PcInstance player : L1World.getInstance().getVisiblePlayer((L1Object)pc, 18)) {
                        if (pc.getParty().isMember(player)) {
                            if (player.hasSkillEffect(205))
                                player.removeSkillEffect(205);
                            player._CubeEffect = true;
                            player.addDmgup(4);
                            player.addHitup(4);
                            player.send_effect(this._skill.getCastGfx());
                            on_icons(player, 205, this._getBuffIconDuration);
                            player.setSkillEffect(205, (this._skill.getBuffDuration() * 1000));
                        }
                    }
                    break;
            }
    }

    private void useShape_Change(L1Character cha) {
        boolean isSameClan = false;
        if (cha instanceof L1PcInstance) {
            L1PcInstance pc = (L1PcInstance)cha;
            if (pc.getClanid() != 0 && this._player.getClanid() == pc.getClanid())
                isSameClan = true;
            if (pc.getId() != this._player.getId() && (pc.getSkillEffectTimeSec(80012) > 0 || pc.getSkillEffectTimeSec(80013) > 0)) {
                pc.sendPackets((ServerBasePacket)new S_SkillSound(pc.getId(), 15846));
                pc.broadcastPacket((ServerBasePacket)new S_SkillSound(pc.getId(), 15846));
                this._player.sendPackets((ServerBasePacket)new S_ServerMessage(280));
                return;
            }
        }
        if (cha instanceof L1MonsterInstance) {
            L1MonsterInstance mon = (L1MonsterInstance)cha;
            if (!mon.getNpcTemplate().isShapeChange())
                return;
        }
        if (this._player.getId() != cha.getId() && !isSameClan) {
            int probability = 80;
            int rnd = this.random.nextInt(100) + 1;
            if (rnd > probability)
                return;
        }
        int pid = this.random.nextInt(Config.MagicAdSetting.POLYARRAY.length);
        int polyId = Config.MagicAdSetting.POLYARRAY[pid];
        if (cha instanceof L1PcInstance) {
            L1PcInstance pc = (L1PcInstance)cha;
            if (pc.getInventory().checkItem(4100500) || pc.getInventory().checkItem(4100610)) {
                pc.ShapePolyRingMaster();
            } else if (pc.getInventory().checkEquipped(20281)) {
                pc.sendPackets((ServerBasePacket)new S_Message_YN(180));
            } else {
                L1Skills skillTemp = SkillsTable.getInstance().getTemplate(67);
                L1PolyMorph.doPoly((L1Character)pc, polyId, skillTemp.getBuffDuration(), 1, false, false);
                if (this._player.getId() != pc.getId())
                    pc.sendPackets((ServerBasePacket)new S_ServerMessage(241, this._player.getName()));
            }
        } else if (cha instanceof L1MonsterInstance) {
            L1MonsterInstance mon = (L1MonsterInstance)cha;
            L1Skills skillTemp = SkillsTable.getInstance().getTemplate(67);
            L1PolyMorph.doPoly((L1Character)mon, polyId, skillTemp.getBuffDuration(), 1, false, false);
        }
    }

