    private void detection(L1PcInstance pc, boolean detectAll) {
        if (pc == null)
            return;
        if (pc.isGmInvis())
            return;
        if (pc.isGhost())
            return;
        if (pc.hasSkillEffect(60))
            pc.delInvis();
        if (pc.hasSkillEffect(97)) {
            if (pc.hasSkillEffect(396))
                return;
            pc.delInvis();
        }
        if (detectAll) {
            for (L1PcInstance tgt : L1World.getInstance().getVisiblePlayer((L1Object)pc)) {
                if (tgt.isGm())
                    continue;
                if (tgt.isGhost())
                    continue;
                if (tgt.hasSkillEffect(60))
                    tgt.delInvis();
                if (!tgt.hasSkillEffect(97) ||
                        tgt.hasSkillEffect(396))
                    continue;
                tgt.delBlindHiding();
            }
            L1WorldTraps.getInstance().onDetection(pc);
        }
    }

    private boolean isTargetCalc(L1Character cha) {
        if (this._skill.getTarget().equals("attack") && this._skillId != 18 &&
                isPcSummonPet(cha) && (
                this._player.getZoneType() == 1 || cha.getZoneType() == 1 || this._player.checkNonPvP(this._player, cha)))
            return false;
        if (this._skillId == 66 && this._user.getId() == cha.getId())
            return false;
        if (cha instanceof L1PetInstance) {
            L1PetInstance pet = (L1PetInstance)cha;
            if (this._user.getId() == pet.getMaster().getId())
                return false;
        }
        if (cha instanceof MJCompanionInstance &&
                this._user.getId() == ((MJCompanionInstance)cha).get_master_id())
            return false;
        if (this._skillId == 69 &&
                this._user.getId() != cha.getId())
            return false;
        return true;
    }

    private boolean isPcSummonPet(L1Character cha) {
        if (this._calcType == 1)
            return true;
        if (this._calcType == 2) {
            if (cha instanceof L1SummonInstance) {
                L1SummonInstance summon = (L1SummonInstance)cha;
                if (summon.isExsistMaster())
                    return true;
            }
            if (cha instanceof L1PetInstance || cha instanceof MJCompanionInstance)
                return true;
        }
        return false;
    }

    private boolean isUseCounterMagic(L1Character cha) {
        if (!this._skill.isIgnoresCounterMagic() &&
                cha.hasSkillEffect(31)) {
            cha.removeSkillEffect(31);
            cha.broadcastPacket((ServerBasePacket)new S_SkillSound(cha.getId(), 10702));
            if (cha instanceof L1PcInstance) {
                L1PcInstance pc = (L1PcInstance)cha;
                pc.sendPackets((ServerBasePacket)new S_SkillSound(pc.getId(), 10702));
            }
            return true;
        }
        return false;
    }

    private boolean isTargetFailure(L1Character cha) {
        boolean isTU = false;
        boolean isErase = false;
        boolean isManaDrain = false;
        int undeadType = 0;
        if (cha instanceof l1j.server.server.model.Instance.L1TowerInstance || cha instanceof l1j.server.server.model.Instance.L1DoorInstance)
            return true;
        if (cha instanceof L1PcInstance) {
            if (this._calcType == 1 && this._player.checkNonPvP(this._player, cha)) {
                L1PcInstance pc = (L1PcInstance)cha;
                if (this._player.getId() == pc.getId() || (pc.getClanid() != 0 && this._player.getClanid() == pc.getClanid()))
                    return false;
                return true;
            }
            return false;
        }
        if (cha instanceof L1MonsterInstance)
            isTU = ((L1MonsterInstance)cha).getNpcTemplate().get_IsTU();
        if (cha instanceof L1MonsterInstance)
            isErase = ((L1MonsterInstance)cha).getNpcTemplate().get_IsErase();
        if (cha instanceof L1MonsterInstance)
            undeadType = ((L1MonsterInstance)cha).getNpcTemplate().get_undead();
        if (cha instanceof L1MonsterInstance)
            isManaDrain = true;
        if ((this._skillId == 18 && (undeadType == 0 || undeadType == 2)) || (this._skillId == 18 && !isTU) || ((this._skillId == 153 || this._skillId == 29 || this._skillId == 30001 || this._skillId == 30000 || this._skillId == 39 || this._skillId == 777777) && !isErase) || (this._skillId == 39 && !isManaDrain))
            return true;
        return false;
    }

